import React from 'react'

import { connect } from 'react-redux';

import Pages from '../Pages/Pages';

import {
  Col,
  Row,
  Table,
  Image,
  OverlayTrigger,
  Popover
} from 'react-bootstrap';

import { FaInfoCircle } from 'react-icons/fa';


function ManageProducts(props) {


    const popover  = (props) => (
      <Popover id="popover-basic">
        <Popover.Content>
          And here's some <strong>amazing</strong> content. It's very engaging.
          right?
        </Popover.Content>
      </Popover>
    );

  
    return (
      <>
        <Row className="mt-5">
          <p className="my-agents-table-label" style={{ fontSize: '30px', fontFamily: 'Poppins SemiBold' }}>Products management</p>
          <OverlayTrigger
            placement="right"
            delay={{ show: 100, hide: 2000 }}
            overlay={popover}
          >

          {/* <OverlayTrigger trigger="click" placement="right" overlay={popover}> */}
            
          {/* <Button variant="success">Hover me to see</Button> */}
          <FaInfoCircle color={"#4080FF"} size={'15'} />
        </OverlayTrigger>
        </Row>

        {/* <Pages /> */}


      </>
    )
}

const mapStateToProps = (state) => {
  return {
    socialMediaPageSelected : state.socialMediaR.socialMediaPageSelected,
  }
};

export default connect(mapStateToProps, { })(ManageProducts);
